	data:{username:'用户',
			mylist:[],
			all:0
			
	},
	computed:{
	itemindex(){
		let index=[]
		for(let item of this.mylist)
		{console.log(item.id)
			index.push(item.id)
		}
		return index.toString()
	},
	itemsrc(){
		let src=[]
		for(let item of this.mylist)
		{console.log(item.src1)
			src.push(item.src1)
		}
		return src.toString()
	},
	itemnum(){
		let src=[]
		for(let item of this.mylist)
		{
			src.push(item.buynum)
		}
		return src.toString()
	},
	itemname(){
		let src=[]
		for(let item of this.mylist)
		{console.log(item.name)
			src.push(item.name)
		}
		return src.toString()
	},
	itemall(){
		let src=[]
		for(let item of this.mylist)
		{
			src.push(item.buynum*item.price)
		}
		return src.toString()
	}
	},
	methods:{
		computeall(){
			this.all=0
		for(let item of this.mylist){
			this.all+=item.buynum*item.price
		}
		}
	},
  router,
  store,
  render: h => h(App)
}).$mount('#app')
